        <div style={{display:'flex', flexDirection:'column', justifyContent:'center'}}>
            <div style={{height:'50vh'}}>
                Window To display
            </div>
            <input style={{width:'200px', border:'1px solid black'}} placeholder='Enter the story' value={searchQ} onChange={(e) => setSearchQ(e.target.value)} />
        </div>
    )
}

export default ChatGptUi
